    "Biology of nesting Aleutian Canada goose, summer 1975",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:19.823287",nt"name": "biology-of-nesting-aleutian-canada-goose-summer-1975",nt"isopen":
    false,nt"url": null,nt"notes": "In 1974 and 1975 breeding Aleutian Canada
    geese, Branta canadensis leucopareia, were studied at Buldir Island, western Aleutian
    Islands. Buldir is the only known breeding station for this endangered subspecies.
    In 1974 geese arrived from an unknown wintering area during the first week in May,
    and some were laying by May 20. Due to the late spring, involving cooler than normal
    temperatures and lingering snow from the deepest snowfall on record, geese nested
    about one week later in 1975. Nests were search for each year. Incomplete coverage
    of the island revealed 30 nests in 1974 and 45 in 1975. The 1975 count my represent
    only about 25% of the total nests actually on Buldir. Clutch size averaged 5.4 and
    5.9 in the two years. At least some geese departed Buldir during the first week
    of September but most remained when investigators left on September 6, 1974 and
    September 5, 1975.",nt"license_title": "License Not Specified",nt"extras":
